import React from 'react'
import {Card, Button} from 'react-bootstrap'


class ProductCard extends React.Component{
    render(){
        return(
            <div>
                <Card border="info" className="m-3" style={{ width: '90%', borderRadius: '5px'}}>
                    <Card.Img variant="top" src={"./media/products/" + this.props.product.filename + "-1.png"} />
                    <Card.Body>
                    <Card.Title>{this.props.product.name}</Card.Title>
                    <Card.Text>
                        ${this.props.product.price}
                    </Card.Text>
                    </Card.Body>
                    <Button variant="info" style={{float: "right"}} className="position-absolute">Details</Button>
                </Card>
            </div>
        )
    }
}

export default ProductCard;
